    false,nt"url": null,nt"notes": "This narrative report for Calhoun National
    Wildlife Refuge outlines Refuge accomplishments from January through April of 1949.
    The report begins by summarizing the weather conditions, water conditions, and food
    and cover during this period. Wildlife including migratory birds, furbearers, raptors,
    and fish is also covered. The Refuge development and maintenance section discusses
    physical developments. Resource management is outlined; topics include commercial
    fishing. The public relations section of the report describes recreational uses
    and fishing. NR forms are attached.",nt"license_title": "License Not Specified",nt"extras":
